import './addNewRoom.css';
import { useState } from 'react';
import CreateRoom from '../../Components/creatingroom/CreateRoom';

const AddNewRoom = (props) => {

    const [screen, setScreen] = useState(true);

    function handleClickAddNewRoom() {
      setScreen(false);
      console.log(screen)
    }

    if (screen === true) {
      return (
        <div className="add-new-room" >
          <div className="bg-new-room" onClick={handleClickAddNewRoom}></div>
          <CreateRoom on={handleClickAddNewRoom}></CreateRoom>
        </div>      
      )
    }    
};

export default AddNewRoom;
